export const saveBlogPost = async (blogPost: BlogPost): Promise<BlogPost> => {
    // Giả lập API call
    return new Promise((resolve) => {
        setTimeout(() => {
            resolve({
                ...blogPost,
                id: blogPost.id || Math.random().toString(36).substring(2, 9)
            });
        }, 1500);
    });
};

